import React, {useState} from 'react'
import { Form, ToggleButton, ToggleButtonGroup } from 'react-bootstrap';

export default function FederationForm({ federations, set }){
  const [federationValue, setFederationValue] = useState([])
  const handleChange = (val) => setFederationValue(val);
  return (
    <ToggleButtonGroup type="checkbox" value={federationValue} onChange={handleChange}>
      {federations.map((federation, index) => {
        return (
          <ToggleButton id={`tbg-btn${index}`} value={index}>
            {federation}
          </ToggleButton>
          )
        })
      }
  </ToggleButtonGroup>
  )
}

